import React, { Component } from 'react';
import styles from "./navbar.module.css";
import logo from "../picture/logo.JPG";
import styled from "styled-components";
const Mydiv=styled.div`
width: 35px;
height: 30px;
margin: 10px 10px;
position: relative;
cursor: pointer;
display: inline-block;
&span{
    background-color:#FFF;
    position: absolute;
    border-radius: 2px;
    transition: .3s cubic-bezier(.8, .5, .2, 1.4);
    width:100%;
    height: 4px;
  }
&span:nth-child(1){
    top:0px;
    left: 0px;
  }
&span:nth-child(2){
    top:13px;
    left: 0px;
  }
&span:nth-child(3){
    bottom:0px;
    left: 0px;
  }
&:not(.open):hover span:nth-child(1){
    transform: scaleX(.8);
  }
`
class Navbar extends Component {
    render() {
        return (
        <div className={styles.navbar}>
            <div className={styles.navicon8}>
    <span></span>
    <span></span>
    <span></span>
  </div>
            <ul className={styles.list}>
                <li>Home</li>
                <li>Biography</li>
                <li>Bussines</li>
                <li>Entertainment</li>
            </ul>
            <img className={styles.img_logo} src={logo} alt='Logo'/>   
            </div>
        );
    }
}

export {Navbar};
